import { useParams } from "react-router-dom";
const EventDetailPage = (props) => {
	const params = useParams();
	return (
		<div>
			<p>Event Detail Page</p>
			<h1>Event detail {params.eventId}</h1>
		</div>
	);
};

export default EventDetailPage;
